import { useParams } from "react-router-dom";
//const id='';

function CoopSchedule()
{
    const CoopSchedule = () => 
    {
        let id = useParams();
        return(id);
    };

    console.log(CoopSchedule());
    
    return(
        <div>
            <h1>Your Coop Schedule</h1>
            <table>
                <thead>
                    <tr>
                        <th>Weekday</th>
                        <th>Subject</th>
                        <th></th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td>Weekday</td>
                        <td>Subject</td>
                        <td></td>
                    </tr>
                </tbody>
            </table>
        </div>
    )
}

export default CoopSchedule;
